function Menu() {
    const arrayMenu = [
        "Trang chủ",
        "Giới thiệu",
        "Sản phẩm",
        "Liên hệ",
        "Đăng nhập",
        "Đăng ký",
        "Tin tức",
        "Thông tin",
];
    
    return (
        <>
            <ul>
                {arrayMenu.map((item,index) => (
                     <li key={index}>
                         <Link to="/">{item}</Link>
                     </li>
                 ))}
             </ul>  
        </>
    )
}
export default Menu;
